export default function DisplayData({userData}) {
  return (
    <div className='d-flex justify-content-center '>
        {userData &&userData.map((item)=>{
          return (<div className='card w-50'>
            <p>{item.username} <br /> {item.password}</p>
            <hr />
          </div>
          )
        })}
    </div>
  )
}
